webpackJsonp([0xf927f8900006],{379:function(e,t){e.exports={data:{site:{siteMetadata:{title:"freeCodeCamp Wellington",subtitle:"Learn to code for free.",copyright:"© All rights reserved.",menu:[{label:"Articles",path:"/"},{label:"About us",path:"/about/"},{label:"Contact us",path:"/contact/"}],author:{name:"freeCodeCamp Wellington",linkedin:"#",twitter:"#",github:"freecodecamp-wellington"}}},markdownRemark:{id:"/home/travis/build/freecodecamp-wellington/freecodecamp-wellington.github.io/src/pages/pages/2018-03-28---about/index.md absPath of file >>> MarkdownRemark",html:'<p>Welcome to the freeCodeCamp Wellington Meetup group. It’s a study group for all levels of coders and totally free.</p>\n<p>freeCodeCamp is a non-profit organisation teaching anyone to code. Learn with the full stack curriculum, available entirely online: <a href="http://www.freecodecamp.com/">http://www.freecodecamp.com/</a></p>\n<p>This is a group for all Campers who want to get together and code collaboratively. We will set regular Meetups but feel free to plan your own and get together! This is a very open group dedicated to helping everyone learn together.</p>\n<p>If you haven’t already signed up for freeCodeCamp please sign up and completed the “Getting Started” section, and we can give you a helping hand from there if required.</p>\n<p>Let’s get together and learn, share, pair-program, and socialise!</p>',frontmatter:{title:"About us",date:null,description:null}}},pathContext:{slug:"/about"}}}});
